import React from 'react';

function About() {

    const bannerImg = {
        backgroundImage: 'url("/images/aboutBanner.jpg")',
        backgroundPosition: 'center',
        backgroundSize: 'cover',
        height: '30vh',
    }

    const bannerTxt = {
        color: '#fff',
        margin: '0',
        fontFamily: 'arial, san-serif',
        fontSize: '4.5vw',
        fontWeight: '400',
        textAlign: 'left',
    }

    const buttonCont = {
        display: 'inline-block',
        float: 'left',
        margin: '1vw 0 0 0',
    }

    const btn = {
        height: '3vw',
        fontSize: '1.4vw',
        border: 'none',
        color: 'white',
        background: 'radial-gradient(circle, rgba(245,246,250,.3) 0%, rgba(26,56,111,0) 100%)',
    }

    const textCont1 = {
        background: 'rgba(26,56,111,.5)',
        padding: '6vw 0 20px 6vw',
        flex: '1',

    }
    const textCont2 = {
        display: 'block',
        background: 'rgba(100,100,100,.5)',
        flex: '1',
    }

  return (
    <div className="content">
        <div className="banner" style={ bannerImg }>
            <div style={ textCont1 }>
                <h2 style={ bannerTxt }>
                    Your Plan. <br/>
                    Our Execution.
                </h2>
            </div>
            <div style={ textCont2 }></div>
        </div>
    </div>
  );
}

export default About;
